pragma solidity ^0.7.0;
pragma experimental ABIEncoderV2;

import "./RLPEncode.sol";

contract EthereumClient {
    // using RLP for RLP.RLPItem;
    // using RLP for RLP.Iterator;
    // using RLP for bytes;

    struct BlockHeader {
        bytes32 hash;
        bytes32 parentHash;
        uint256 nonce;
        uint256 timestamp;
        bytes32 ommersHash;  // sha3Uncles
        address miner;       // beneficiary
        bytes32 logsBloom;  // OR of all transaction receipt Bloom filters ?
        uint256 difficulty;
        uint256 totalDifficulty;
        bytes32 extraData;
        uint256 number;
        uint256 gasLimit;
        uint256 gasUsed;
        bytes32 mixHash;     // ?
        bytes32 stateRoot;
        bytes32 transactionsRoot;
        bytes32 receiptsRoot;  // root hash of transaction receipts trie
        // uint256 size; ?
    }

    struct AccountState {
        uint256 nonce;
        uint256 balance;
        bytes32 storageRoot;
        bytes32 codeHash;
    }

    // state trie: key-value ; address-rlp(AccountState)

    struct Transaction {
        uint256 nonce;
        uint256 gasPrice;
        uint256 gasLimit;
        uint256 value;
        address to;
        bytes data;
        uint8 v;
        bytes32 r;
        bytes32 s;
    }

    struct Log {
        uint256 somth;
    }

    struct TransactionReceipt {
        uint256 blockNumber;
        bytes32 blockHash;
        bytes32 transactionHash;
        uint256 gasUsed;
        uint256 cummulativeGasUsed;
        Log[] logs;
    }

    function getSignedTransaction(
        uint256 nonce,
        uint256 gasPrice,
        uint256 gasLimit,
        uint256 value,
        address to,
        bytes memory data,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) public pure returns (bytes memory signedTransaction) {

    }

    // keccak256(signedTransaction)
    function getTransactionHash(bytes memory signedTransaction) public pure returns (bytes32 hash) {
        hash = keccak256(signedTransaction);
    }

    function getBlockHash(BlockHeader memory header) public pure returns (bytes memory) { // (bytes32 hash) {
        bytes memory rlpencoded = abi.encodePacked(
            RLPEncode.encodeBytes(abi.encodePacked(header.parentHash)),
            RLPEncode.encodeUint(header.nonce),
            RLPEncode.encodeUint(header.timestamp),
            RLPEncode.encodeBytes(abi.encodePacked(header.ommersHash)),
            RLPEncode.encodeAddress(header.miner),
            RLPEncode.encodeBytes(abi.encodePacked(header.logsBloom)),
            RLPEncode.encodeUint(header.difficulty)
        );
        rlpencoded = abi.encodePacked(
            rlpencoded,
            RLPEncode.encodeBytes(abi.encodePacked(header.extraData)),
            RLPEncode.encodeUint(header.number),
            RLPEncode.encodeUint(header.gasLimit),
            RLPEncode.encodeUint(header.gasUsed),
            RLPEncode.encodeBytes(abi.encodePacked(header.mixHash)),
            RLPEncode.encodeBytes(abi.encodePacked(header.stateRoot)),
            RLPEncode.encodeBytes(abi.encodePacked(header.transactionsRoot)),
            RLPEncode.encodeBytes(abi.encodePacked(header.receiptsRoot))
        );
        return rlpencoded;
    }

    function checkCodeHash(bytes32 codehash, bytes32 blockhash) pure public returns(bool isFromBlock) {





    }
}

